import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:443/books')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.log(error);
      });
  }, []);

  return (
    <div>
      <h1>Users</h1>
      <ul>
        {data.map(book => (
          <li key={book.id}>{book.title}</li>))}
      </ul>
    </div>
  );
}

export default App;
